import "./App.css";
import Card from "./contact";
import Api from './api';

function contact(curEle){
  return (
    <Card name={curEle.name} img={curEle.img} tel={curEle.tel}/>
   )
}
function App() {

  return (
    <>
    <div className="contanier">
     <div className="con-2">
     <div className="header">
      <h1>my contact list </h1>
      </div>
      <div className="child">
      {Api.map(contact)}
      </div>
     </div>
    </div>
    </>
  );
}

export default App;
